	public static function parse($url,$html)
	{
		$type = get_class();		
		$thiz = self::getInstance();

		$ap = new Address_Parser();
		$pp = new phone_parser();
		$ep = new Email_Parser();
		$kvp = new KeyValue_Parser();	
		$urls = array();
		log::info($url);
		//parse_str(parse_url($url,PHP_URL_QUERY),$query); 

	//	file_put_contents("$type.html",$html);	


		$xtop =  new  XPath($html);
		foreach($xtop->query("//div[contains(@class,'vcard')]") as $nodeTop)
		{
			$x =  new  XPath($nodeTop);	
			$data = array();

			foreach($x->query("//*[contains(@class,'fn n org')]") as $node)
			{
				$data['COMPANY'] =  self::cleanup($node->textContent);

				if ($node->tagName == 'a')
					$data['WEBSITE'] = $node->getAttribute("href");

			}

			foreach($x->query("//span[@class='street-address']") as $node)
			{
				$data['ADDRESS'] = self::cleanup($node->textContent);
			}

			foreach($x->query("//span[@class='locality']") as $node)
			{
				$data['CITY'] = self::cleanup($node->textContent);
			}

			foreach($x->query("//span[@class='region']") as $node)
			{
				$data['STATE'] = self::cleanup($node->textContent);
			}
			foreach($x->query("//span[@class='postal-code']") as $node)
			{
				$data['ZIP'] = self::cleanup($node->textContent);
			}

			foreach($x->query("//span[@class='tel']") as $node)
			{
				$data['PHONE'] = self::cleanup($node->textContent);
			}

			foreach($x->query("//span[@class='fax']") as $node)
			{
				$data['FAX'] = self::cleanup($node->textContent);
			}

			foreach($x->query("//a[@class='email']") as $node)
			{
				$data['EMAIL'] = self::cleanup($node->textContent);
			}
			
			$data['COUNTRY'] = 'United States';

			$data['SOURCE_URL'] = $url;
			log::info(db::normalize($data));
			db::store($type,$data,array('COMPANY','ADDRESS','PHONE','EMAIL'));			
		}
	}
}


